import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="navbar">
      <Link to="/">
        <h1>The Reel Ones</h1>
      </Link>
      <Link>Films</Link>
    </div>
  );
};

export default Navbar;
